import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

//styles
import './App.scss'
import Navbar from "./Components/Navbar";

//pages
import Home from "./Pages/Home";

function App() {
  return (
    <React.Fragment>
      <Navbar />
  <Router>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
    </React.Fragment>

  );
}

export default App;
